from math import cos

def find_x(x):
    return cos(3*x)**3 + cos(5*x)**3 - 8*cos(4*x)**3*cos(x)**3

def find_x_interval():
    low = 100
    high = 200
    while True:
        x = (low + high) / 2
        if find_x(x) < 0:
            low = x
        else:
            high = x
        if abs(high - low) < 1e-10:
            return low

x = find_x_interval()
print(x)

