from math import sqrt

def matrix_norm(matrix):
    return sqrt(sum(x**2 for x in matrix))

def vector_norm(vector):
    return sqrt(sum(x**2 for x in vector))

def smallest_positive_number(matrix):
    return matrix_norm(matrix) / vector_norm(matrix)

C = smallest_positive_number([2, 3, 0, -2])
print(C)

from math import cos

def is_rational(x):
    """
    Return True if x is rational, False otherwise.
    """
    try:
        x.as_integer_ratio()
        return True
    except TypeError:
        return False

def is_irrational(x):
    return not is_rational(x)

def find_largest_n(theta):
    for n in range(1, 1000000):
        for k in range(1, n):
            if is_rational(cos(k * theta)):
                return n - 1
    return None

theta = 0.5
largest_n = find_largest_n(theta)
print(largest_n)

