from math import sin

def find_solutions(func, lower_bound, upper_bound, eps=1e-10):
    solutions = []
    for x in range(int(lower_bound), int(upper_bound) + 1):
        if abs(func(x) - x) < eps:
            solutions.append(x)
    return solutions

solutions = find_solutions(sin, 0, 6)
print(len(solutions))

import numpy as np

def distance(a, b):
    return np.linalg.norm(a - b)

def find_t(a, b):
    return (b - a).dot(b - a) / (distance(a, b) ** 2)

def find_u(a, b):
    return (a - b).dot(a - b) / (distance(a, b) ** 2)

def find_point(a, b):
    return a + t * (b - a)

a = np.array([3, -10, 1])
b = np.array([2, -9, -2])
u = find_u(a, b)
t = find_t(a, b)
print(distance(find_point(a, b), find_point(a, b) + u * (b - a)))

